CREATE TABLE sys.sysdatabases
(
    name sysname NOT NULL,
    dbid smallint,
    sid varbinary(85),
    mode smallint,
    status int,
    status2 int,
    crdate datetime NOT NULL,
    reserved datetime,
    category int,
    cmptlevel tinyint NOT NULL,
    filename nvarchar(260),
    version smallint
);
